import React, { useState } from 'react';
import axios from 'axios';
import { Box, Button, Container, Skeleton, TextField, Typography } from '@mui/material';
import { useTheme } from '@mui/material/styles';

const PhonePricePredictor = () => {
  const [formData, setFormData] = useState({
    battery_power: '',
    blue: '',
    clock_speed: '',
    dual_sim: '',
    fc: '',
    four_g: '',
    int_memory: '',
    m_dep: '',
    mobile_wt: '',
    n_cores: '',
    px_height: '',
    px_width: '',
    pc: '',
    ram: '',
    sc_h: '',
    sc_w: '',
    talk_time: '',
    three_g: '',
    touch_screen: '',
    wifi: '',
  });

  const [prediction, setPrediction] = useState(null);
  const [loading, setLoading] = useState(false);
  const theme = useTheme();

  const labelMapping = {
    battery_power: 'Battery Power (mAh)',
    blue: 'Bluetooth',
    clock_speed: 'Clock Speed (GHz)',
    dual_sim: 'Dual SIM',
    fc: 'Front Camera (MP)',
    four_g: '4G Support',
    int_memory: 'Internal Memory (GB)',
    m_dep: 'Mobile Depth (mm)',
    mobile_wt: 'Mobile Weight (g)',
    n_cores: 'Number of Cores',
    px_height: 'Pixel Height',
    px_width: 'Pixel Width',
    pc: 'Primary Camera (MP)',
    ram: 'RAM (MB)',
    sc_h: 'Screen Height (mm)',
    sc_w: 'Screen Width (mm)',
    talk_time: 'Talk Time (hrs)',
    three_g: '3G Support',
    touch_screen: 'Touch Screen',
    wifi: 'WiFi Support',
  };

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    
    try {
      const response = await axios.post('https://mobileprice-production.up.railway.app/predict', formData);
      setPrediction(response.data.price_range);
    } catch (error) {
      console.error('Error making prediction', error);
    } finally {
      setLoading(false);
    }
  };

  return (
    <Container 
      maxWidth="sm" 
      sx={{ 
        padding: theme.spacing(4), 
        borderRadius: theme.shape.borderRadius, 
        boxShadow: theme.shadows[3], 
        textAlign: 'center',
        mt: 4,
        backgroundColor: '#f5f5f5' // Light grey background for the entire app
      }}
    >
      {prediction ? (
        <Typography variant="h5" mt={3}>
          The predicted price for that type of phone would be: <strong>{prediction}</strong>
        </Typography>
      ) : (
        <>
          <Typography variant="h4" mb={2}>Phone Price Predictor</Typography>
          <Box 
            component="form" 
            onSubmit={handleSubmit} 
            sx={{ display: 'flex', flexWrap: 'wrap', gap: 2 }}
          >
            {Object.keys(formData).map((key) => (
              <Box key={key} sx={{ flex: '1 1 21%', minWidth: '150px' }}>
                {loading ? (
                  <Skeleton variant="rectangular" width="100%" height={56} />
                ) : (
                  <TextField
                    fullWidth
                    label={labelMapping[key]}
                    name={key}
                    value={formData[key]}
                    onChange={handleChange}
                    variant="outlined"
                    InputProps={{
                      sx: {
                        height: '56px', // Set a custom height for the input box
                        '& .MuiOutlinedInput-root': {
                          '& fieldset': {
                            borderColor: 'rgba(0, 0, 0, 0.23)', // Default border color
                          },
                          '&:hover fieldset': {
                            borderColor: 'rgba(0, 0, 0, 0.23)', // Default border color on hover
                          },
                          '&.Mui-focused fieldset': {
                            borderColor: '#1976d2', // Default color when focused
                          },
                        },
                        '& .MuiOutlinedInput-input': {
                          color: '#000', // Input text color
                          padding: '10px', // Add padding for better spacing within the input
                        },
                      },
                    }}
                    InputLabelProps={{
                      sx: {
                        color: 'rgba(0, 0, 0, 0.54)', // Default label color
                        whiteSpace: 'nowrap',
                        overflow: 'hidden',
                        textOverflow: 'ellipsis',
                        maxWidth: '100%',
                        display: 'block',
                        lineHeight: '1.5',
                        paddingRight: theme.spacing(1),
                        '&.Mui-focused': {
                          color: '#1976d2',
                        },
                      },
                    }}
                  />
                )}
              </Box>
            ))}
            <Button 
              type="submit" 
              variant="contained" 
              color="primary"
              sx={{ mt: 2 }}
              disabled={loading}
            >
              {loading ? <Skeleton width="50%" /> : "Predict"}
            </Button>
          </Box>
        </>
      )}
    </Container>
  );
};

export default PhonePricePredictor;
